import { Routes, Route, Router} from 'react-router-dom';

import './App.css';
import React from 'react';

import Header from './components/common/header/header.jsx';
import Main from './pages/main'

function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>
          <Route path="/" element={<Main/>}/>
        </Routes>
    </div>
  );
}

export default App;
